package Oerateor;

public class Operatorexample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 55;
		int b= 41;
		System.out.println(a+b);
		System.out.println(a-b);
		System.out.println(a*b);
		System.out.println(a/b);
		System.out.println(a%b);
		
		System.out.println(a<b&&b<a);
		System.out.println(a<b||b<a);
		System.out.println(a++ + ++a);
		System.out.println(b-- + --b);
		System.out.println(a<b);
		System.out.println(a>b);

	}

}
		